import React from "react";
import { ImageBackground, StyleSheet, View, Button, Text } from "react-native";
import Timeline from "react-native-timeline-flatlist";

const image = { uri: "https://i.imgur.com/4ReBwBY.jpeg" };

const data = [
  { time: "09:00", title: "Event 1", description: "Event 1 Description" },
  { time: "10:00", title: "Event 2", description: "Event 2 Description" },
  { time: "11:00", title: "Event 3", description: "Event 3 Description" },
  { time: "12:00", title: "Event 4", description: "Event 4 Description" },
  { time: "13:00", title: "Event 5", description: "Event 5 Description" },
];

const TimelinePage = () => (
  <ImageBackground source={image} resizeMode="cover" style={styles.image}>
    <View>
      <Timeline data={data} />
    </View>
  </ImageBackground>
);

const styles = StyleSheet.create({});

export default TimelinePage;
